I'm thinking of making a new livejournal..not like a completely new thing, but a new name, ya know? What do you all think of that? Because, personally, xo_juicyjulz is getting a little old for me, since I've had it for a year! I know..long time huh? Well, comment me your oppinion..? Maybe I'll make it friends only also..alright, I think I'm pretty set on this idea to make this a new thing. SO, if you could please comment with your idea of what my new user name could be?

HIT THAT THINKIN' CAP AND COMMENT YOUR SUGGESTIONS!

&hearts;

So, yesterday me and Christine went to the mall. I got a super cute hoochie skirt from Pac Sun, and I got another pair of chords from Abercrombie. <3

Then we went to the movies..it was Me, Christine, Mike, Matt, and Vinny. We saw 'White Noise' and it was soooo scary, but I didn't really understand it because I was talking to Matt the whole movie, about random things. We all def. changed hoodies about 10x because I was cold, it was like this massive hot potatoe game, only with hoodies. Wow. Then I practically JUMPED on Matt for the scarrry part, and I almost died. Me and Christine were grabbing on to eachother the whole time, and I almost like ripped her knee off. Before we went to the movies, inbetween the mall and movies, we went to Taco Bell, and the scary greasy man gave Christine her drink for free...it was ackward..

ANYWAYS.. NO school tomorrow.. COMMENT ME &hearts;

I've had a rough day, It turns out I'm taking a "break" off from my closest friends. Oh well, I hope it all turns out okay in the end.



IF YOU ALL WANNA DO ME A FAVOR...

Comment me with 5 words describing my personality. &hearts;

p0WL+

Comment your name, and I will comment back honestly what I think of you. This should be interesting..





&hearts;

I want to change my layout a bit. I like it because it's plain, but I'm thinking of adding something new and exciting. Who knows, give me your opinion! My grandma bought me a fushcia Dooney & Bourke purse  :)  Now, I'm in the christmas spirit! [ I think ]


&hearts; &hearts; &hearts; &hearts; 

I'm in a better mood today. I hope this is getting better guys. Depression=ANNOYING

I GOT MY BRACES OFF!!!! (I'll post pictures later!)


OH HELL YES! Me and Ellen are having a "Rap-Off" today in the library during lunch. BITCHES! I WILL win! Carolyn got the cut versions, and we have beat people! I am so excited! The Canisus dance is tomorrow I can't wait! OMG! I just got my period like 3 minutes into walking into the school building. This sucks so much. I'm going to cry. I have had mine for every Canisus, and St.Joes dance so far! ERRR! I need tampons, but my mom will only buy the cardboard ones, and they hurt :[

Anyways, Have a nice day, and keep on posting!!  &hearts;

W0W..iT`S BEEN A WHiLE!

I don't have much to say lately..Let's see, date dance was retarded, there's a canisus dance coming up on friday, and I'm not sure if I want to go or not. Who knows? Sarah and I were talking about how there is no drama at school at all, not that I want any, but it's ackward. Who knows. I'm like failing out of school, and I'll probably end up at south in January. I don't really know what I think about that. I'm so confused lately. I haven't updated in a long time, because I don't have frees anymore because I'm on academic probation. Oh yess! I didn't have school today, and me and Sarah need boyfriends! So, I'm going to go, and if I still have ANY lj friends anymore maybe I'll get some comments.

&hearts;
